import { Link } from 'react-router-dom';
import * as React from 'react';
import Stack from '@mui/material/Stack';
import Button from '@material-ui/core/Button';




const StartPage = () => {
  return (
    <header>
        <h1>
            Welcome to the Highlighting Extraction UI
        </h1>

        <Stack spacing={2}>
          <Button component={Link} to="/instructions" variant="contained" color="primary">
            Instructions
          </Button>
          
          <Button component={Link} to="/guidedAnnotation" variant="contained" color="primary">
            Guided Annotation
          </Button>

          <Button component={Link} to="/annotation" variant="contained" color="primary">
            Annotation
          </Button>
        </Stack>
    </header>
  )
}

export default StartPage




